import React from 'react';
import './DiceDisplayStyles.scss'









const DiceDisplay = ({leftDice, rightDice}) => {
    return (
            <div className='DiceDisplay-container'>
                <div className='Dice-1'>
           <img src={`/userDicePics/userDice${leftDice}.png`}/>
           <h1>{leftDice}</h1>
                </div>
                <div className='Dice-2'>
                <img src={`/userDicePics/userDice${rightDice}.png`}/>
                </div>


            </div>

    );

    }

export default DiceDisplay
